import React from "react";
import "./Stock.css" ;
import data from "./data/Futu_table" ;
import { JsonToTable } from "react-json-to-table" ;


function Stock() {
  const table = [];
  for(var i = 0 ; i < 10 ; i++){
    table.push(data[i].name) ;
  }


  return (
    <div className="stock">

      <div className="table-container">
        <h1>Hi this is supposed to be a table</h1>

        <JsonToTable json={data} />

        {table.map((data, key) => {
          return(
            <div key={key} >
              {data}
            </div>
          )
        })}

      </div>
      <div className="graphs">
        <div className="engagement">
          <h2>This is for engagement</h2>

        </div>
        <div className="market-attitude">
          <h2>This is for market-attitude</h2>

        </div>
      </div>
    </div>
  );
}

export default Stock;
